import React, { Component } from 'react'

class Header extends Component {
    constructor() {
        super()
        this.state = {
            menuItems:["My Moves", "MY PROFILE", "GET QUOTES", "LOGOUT"]
        };
    }
    render() {
        const navItems = menuItems.map((navItem)=> {
            <li><a href=""><i className="icon fas fa-shipping-fast"></i>{navItem} </a></li>
        })
        return (
            <div>{navItems}</div>
        )

    }

}
export default Header;
